pragma solidity ^0.8.0;

contract PIDtoCIDMapping {
    mapping(string => string) public pidToCid;

    event MappingAdded(string pid, string cid);

    // Add a new PID-CID mapping
    function addMapping(string memory pid, string memory cid) public {
        pidToCid[pid] = cid;
        emit MappingAdded(pid, cid);
    }

    // Retrieve CID by PID
    function getCID(string memory pid) public view returns (string memory) {
        return pidToCid[pid];
    }

    // Retrieve CIDs for multiple PIDs
    function getCIDs(string[] memory pids) public view returns (string[] memory) {
        string[] memory cids = new string[](pids.length);
        for (uint256 i = 0; i < pids.length; i++) {
            cids[i] = pidToCid[pids[i]];
        }
        return cids;
    }
}
